import { api_key } from "../Global"

const FetchGenres = (url) => {
  const genres = fetch(`${url}/genre/movie/list?api_key=${api_key}&language=en-US`)
  .then(res => {
    return res.json()
  })
  .then(data => {
    return data;
  })

  return genres;
}

export default FetchGenres;
